import React from 'react';
import {
  RightAlignedRow,
  StyledAddIcon,
  StyledInput,
  StyledRemoveIcon,
} from './Styles';
import { generateRandomString, removeRow } from './utils';

const AddExpense = ({ additionalRows, setAdditionalRows, className }) => {
  console.log('additional Rows', additionalRows);

  const handleRemoveRow = () => {
    removeRow(additionalRows);
  };

  return (
    <StyledAddIcon
      onClick={() => {
        const uniqueId = generateRandomString();
        setAdditionalRows([
          ...additionalRows,
          <RightAlignedRow id={uniqueId}>
            <StyledInput
              className={className}
              placeholder="Amount"
              variant="outlined"
              type="number"
            />
            <StyledRemoveIcon onClick={handleRemoveRow} />
          </RightAlignedRow>,
        ]);
      }}
    />
  );
};

export default AddExpense;
